import styles from "./styles.module.css";
import logo from "../images/white-rubixe-logo.png"
import image from "../images/160805-facebookacademy-submitted.jpg"
import { Link } from "react-router-dom";

const Main = () => {
	const handleLogout = () => {
		localStorage.removeItem("token");
		window.location.reload();
	};

	return (
		<div className={styles.main_container}>
			<nav className={styles.navbar}>
				<h1><img src={logo} alt="" height="60px" width="200px"/></h1>
				<div>
				<ul type="none">
					<li><Link to="/home">HOME</Link></li>
					<li><Link to="/services">SERVICES</Link></li>
					<li><Link to="/products">PRODUCTS</Link></li>
					<li><Link to="/intenship">AI INTENSHIP</Link></li>
					<li><Link to="/career">CAREER</Link></li>
					<li><Link to="/blog">BLOG</Link></li>
					<li><Link to="/about">ABOUT</Link></li>
					<li><Link to="/contactus">CONTACT US</Link></li>
					<button className={styles.white_btn} onClick={handleLogout}>
					Logout
				</button>
				</ul>
				</div>
			</nav>
			<div className="adv"><img src={image} alt="no image" /></div>
		</div>
	);
};

export default Main;
